<span class="line"><span style="color:#A6ACCD;">空间较小，要求数据读写性能高，数据存放时间较短暂。由编译器自动分配和释放，存放函数的参数值、函数的调用流程方法地址、</span><span style="color:#82AAFF;">局部变量等</span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">局部变量如果产生逃逸现象，可能会挂在在堆区</span><span style="color:#89DDFF;">)</span></span>
